import React from 'react';
import { Link } from 'react-router-dom';
import { makeStyles } from '@material-ui/core';

const useStyles = makeStyles(theme => ({
    pageStyle: {
      background: cyan[400],
    }
  }));

function Home() {
    const classes = useStyles();

    return(
        <div className={classes.pageStyle}>
            <Link to='/mainweather'>
                Mainweather
            </Link>
        </div>
    )
}

export default Home;
